geregisseerd door Mike Mitchell
met de stemmen van Matthew Gray Gubler, Amy Poehler en Jesse McCartney

Alvin, Simon, Theodore en de Chipettes zijn op vakantie aan boord van een luxe cruiseschip. Natuurlijk zijn ze weer bezig om er een feestje van te maken. Maar aan dat plezier komt al snel een eind wanneer het schip strandt op een onbewoond eiland. De Munks en Chipettes komen al gauw voor nog meer verrassingen te staan als ze op avontuur gaan met een schipbreukeling die zich op het eiland bevindt.



